&lt;p&gt;&lt;b&gt;Ambassadeur&reg; Pro Rocket 5500BE - Black Edition&lt;/b&gt;&lt;/p&gt;&lt;p&gt;A continued tradition of Swedish craftsmanship and design, Ambassadeur&reg; Black edition round baitcast reel is now available in additional sizes. Featuring a six pin centrifugal braking system and a robust aluminum construction, the international best seller delivers superior casting performance and rock-solid durability.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Features:&lt;/b&gt;&lt;/p&gt;&lt;ul&gt;
&lt;li&gt;4 stainless steel ball bearings + 1 roller bearing provides smooth operation&lt;/li&gt;
&lt;li&gt;Carbon Matrix&trade; drag system gives smooth drag performance&lt;/li&gt;
&lt;li&gt;6 pin centrifugal brake gives consistent brake pressure throughout the cast&lt;/li&gt;
&lt;li&gt;Synchronized level wind system improves line lay and castability&lt;/li&gt;
&lt;li&gt;Extended bent handle for increased cranking power&lt;/li&gt;
&lt;/ul&gt;&lt;p&gt;&lt;b&gt;Specifications:&lt;/b&gt;&lt;/p&gt;&lt;ul&gt;
&lt;li&gt;Reel Handle Position: Right&lt;/li&gt;
&lt;li&gt;Gear Ratio: 5.3:1&lt;/li&gt;
&lt;li&gt;Retrieve Rate: 26 | 66cm&lt;/li&gt;
&lt;li&gt;Braking System: Centrifugal&lt;/li&gt;
&lt;li&gt;Bearing Count: 5&lt;/li&gt;
&lt;li&gt;Weight: 10.41&lt;/li&gt;
&lt;li&gt;Braid Capacity Yd/Lb:&nbsp;315/20 235/30 165/50&lt;/li&gt;
&lt;li&gt;Mono Capacity Yd/Lb: 295/10 &nbsp;240/12 &nbsp;170/17&lt;/li&gt;
&lt;li&gt;Drag Material: Carbon&lt;/li&gt;
&lt;li&gt;Max Drag: 15lb | 6.8kg&lt;/li&gt;
&lt;li&gt;Reel Spool Material: Aluminum&lt;/li&gt;
&lt;li&gt;Drag Type: Star Drag&lt;/li&gt;
&lt;li&gt;Reel Size: 5500&lt;/li&gt;
&lt;li&gt;Anti-Reverse Feature: Instant Anti-Reverse&lt;/li&gt;
&lt;/ul&gt; &lt;!--- cis:y4w2Om4GJ5A= ---&gt;Abu Garcia Ambassadeur&reg; Pro Rocket 5500BE - Black Edition&lt;p&gt;&lt;u&gt;Condition&lt;/u&gt; : This item is brand new, unopened and sealed in its original factory box.&lt;/p&gt;

